class BarcodeReader {
  constructor(modulePromise) {
    this.modulePromise = modulePromise;
    this.#c = new OffscreenCanvas(0, 0);
    this.#ctx = this.#c.getContext("2d", {
      willReadFrequently: true
    });
  }
  #c;
  #ctx;
  #r;
  async init() {
    const module = await this.modulePromise;
    console.log(module.DESCR);
    this.#r = new module.Reader();
    this.#r.setChannel(4);
  }
  resize(width, height) {
    this.#c.width = width;
    this.#c.height = height;
    this.#r.resizeBuf(width, height);
  }
  readVideoFrame(frame) {
    this.#ctx.drawImage(frame, 0, 0);
    const imageData = this.#ctx.getImageData(0, 0, frame.displayWidth, frame.displayHeight);
    const buf = this.#r.getBuf();
    buf.set(imageData.data);
    return this.#r.read();
  }
  read(image) {
    this.#c.getContext("bitmaprenderer")?.transferFromImageBitmap(image);
    const imageData = this.#ctx.getImageData(0, 0, image.width, image.height);
    const buf = this.#r.getBuf();
    buf.set(imageData.data);
    return this.#r.read();
  }
}

function createStreamReader(reader, stream) {
  const initializeTask = reader.init();
  const track = stream.getVideoTracks()[0];
  let pause = false;
  let started = false;
  const start = async function start2(onResult) {
    if (started) {
      throw new Error("Already started");
    }
    started = true;
    pause = false;
    await initializeTask;
    const settings = track.getSettings();
    reader.resize(settings.width, settings.height);
    for await (const frame of new MediaStreamTrackProcessor({ track }).readable) {
      if (pause) {
        return;
      }
      const barcodes = reader.readVideoFrame(frame);
      if (barcodes.size() > 0) {
        onResult(barcodes);
      }
    }
    started = false;
  };
  return {
    start,
    pause: () => pause = true,
    abort: () => {
      pause = true;
      track.stop();
    }
  };
}

async function* listAllVideoDevices() {
  const devices = await navigator.mediaDevices.enumerateDevices();
  for (const device of devices) {
    if (device.kind === "videoinput" || device.kind === "video") {
      yield {
        deviceId: device.deviceId || device.id,
        groupId: device.groupId,
        kind: device.kind,
        label: device.label
      };
    }
  }
}
async function accuireUserMediaVideoStream(deviceId) {
  return await navigator.mediaDevices.getUserMedia({
    video: deviceId ? {
      deviceId: { exact: deviceId }
    } : {
      facingMode: "environment"
    }
  });
}

